function Main() {
  const { darkMode } = useDarkMode(); //dark mode

  return (
    <main className={`container`}>
      <Routes>
        <Route path="/" element={<Home />}></Route>
        <Route path="Home" element={<Home />}></Route>
        <Route path="FlagDetails" element={<FlagDetails />}></Route>
      </Routes>
    </main>
  );
}

export default Main;
